import React, { useState } from 'react';
import './LoginPage.css';

const LoginPage = () => {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [error, setError] = useState('');
    const [success, setSuccess] = useState('');
    const [showPassword, setShowPassword] = useState(false); // State for showing password

    const handleSubmit = async (e) => {
        e.preventDefault();

        try {
            const response = await fetch('/api/LoginPage', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify({ email, password }),
            });

            const result = await response.json();

            if (response.ok) {
                setSuccess('Login successful! Redirecting...');
                setError('');
                // Redirect to localhost:3000 after a short delay
                setTimeout(() => {
                    window.location.href = 'http://localhost:3000'; // Change to your desired redirect
                }, 2000);
            } else {
                // Display appropriate error messages
                if (result.error) {
                    setError(result.error);
                } else if (result.message === 'User not found') {
                    setError('Account not found. Please check your email.');
                } else if (result.message === 'Invalid password') {
                    setError('Invalid password. Please try again.');
                } else {
                    setError('Invalid credentials, please try again.');
                }
                setSuccess('');
            }
        } catch (error) {
            setError('Something went wrong, please try again.');
            setSuccess('');
        }
    };

    // Function to toggle password visibility
    const togglePasswordVisibility = () => {
        setShowPassword(!showPassword);
    };

    return (
        <div className="login-page">
            <nav className="navbar">
                <div className="navbar-content">
                    <button className="navbar-button" onClick={() => window.location.href = '/login-page'}>
                        Zenith Bank
                    </button>
                </div>
            </nav>

            <div className="login-container">
                <h1>Login</h1>
                <form onSubmit={handleSubmit} className="login-form">
                    <div className="form-group">
                        <label htmlFor="email">Email</label>
                        <input
                            type="email"
                            id="email"
                            value={email}
                            onChange={(e) => setEmail(e.target.value)}
                            placeholder="email"
                            required
                        />
                    </div>
                    <div className="form-group">
                        <label htmlFor="password">Password</label>
                        <div className="password-input-container">
                            <input
                                type={showPassword ? 'text' : 'password'}
                                id="password"
                                value={password}
                                onChange={(e) => setPassword(e.target.value)}
                                required
                                placeholder="password"
                                pattern="(?=.*\d)(?=.*[a-z])(?=.*[A-Z]).{8,}"
                                title="Password must be at least 8 characters long, and include at least one number, one uppercase, and one lowercase letter."
                            />
                            {/* Checkbox to toggle password visibility */}
                            <label>
                                <input
                                    type="checkbox"
                                    checked={showPassword}
                                    onChange={togglePasswordVisibility}
                                />
                                Show Password
                            </label>
                        </div>
                    </div>
                    <button className="login-button" type="submit">Login</button>
                    <span className="register-text" onClick={() => window.location.href = '/create-user'}>
                        Don't have an account? Register here!
                    </span>
                </form>

                {/* Error and success messages */}
                <div className="message-container">
                    {error && (
                        <div className="error-container">
                            <h2>Error</h2>
                            <p className="error">{error}</p>
                        </div>
                    )}
                    {success && (
                        <div className="success-container">
                            <h2>Success</h2>
                            <p className="success">{success}</p>
                        </div>
                    )}
                </div>
            </div>
        </div>
    );
};

export default LoginPage;
